import React, { useState } from 'react';
import './Signup.css';
import { RequiredValidate, GmailValidate, PhoneValidate, PasswordValidate, rePasswordValidate } from './errorhandling';

const Signup = () => {
  // State to manage form data
  const [formData, setFormData] = useState({
    fname: '',
    lname: '',
    gmail: '',
    phone: '',
    password: '',
    rePassword: '',
  });

  // State to manage errors
  const [errors, setErrors] = useState({
    fname: '',
    lname: '',
    gmail: '',
    phone: '',
    password: '',
    rePassword: '',
  });

  // Handle form data change
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value, // Update the value of the field being changed
    }));
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    // Validate form fields
    const newErrors = {
      fname: RequiredValidate(formData.fname, 'First Name'),
      lname: RequiredValidate(formData.lname, 'Last Name'),
      gmail: GmailValidate(formData.gmail),
      phone: PhoneValidate(formData.phone),
      password: PasswordValidate(formData.password),
      rePassword: rePasswordValidate(formData.password, formData.rePassword),
    };

    // If there are errors, set them, otherwise submit the form
    if (Object.values(newErrors).some((error) => error !== '')) {
      setErrors(newErrors); // Set the errors if any
    } else {
      // Handle form submission (e.g., send data to server)
      console.log('Form submitted successfully!', formData);
    }
  };

  return (
    <>
      <div className="main-content">
        <div className="flex1"></div>
        <div className="flex2"></div>
      </div>

      <div className="signup-content">
        <form onSubmit={handleSubmit}>
          <div className="fname">
            <label htmlFor="fname">Enter First Name</label>
            <input
              type="text"
              id="fname"
              name="fname"
              value={formData.fname}
              onChange={handleChange}
            />
            {errors.fname && <p className="error-message">{errors.fname}</p>}
          </div>

          <div className="lname">
            <label htmlFor="lname">Enter Last Name</label>
            <input
              type="text"
              id="lname"
              name="lname"
              value={formData.lname}
              onChange={handleChange}
            />
            {errors.lname && <p className="error-message">{errors.lname}</p>}
          </div>

          <div className="gmail">
            <label htmlFor="gmail">Enter Gmail</label>
            <input
              type="email"
              id="gmail"
              name="gmail"
              value={formData.gmail}
              onChange={handleChange}
            />
            {errors.gmail && <p className="error-message">{errors.gmail}</p>}
          </div>

          <div className="phone">
            <label htmlFor="phone">Phone no.</label>
            <input
              type="text"
              id="phone"
              name="phone"
              value={formData.phone}
              onChange={handleChange}
            />
            {errors.phone && <p className="error-message">{errors.phone}</p>}
          </div>

          <div className="password">
            <label htmlFor="pwd">Create A Strong Password</label>
            <input
              type="password"
              id="pwd"
              name="password"
              value={formData.password}
              onChange={handleChange}
            />
            {errors.password && <p className="error-message">{errors.password}</p>}
          </div>

          <div className="repass">
            <label htmlFor="re-pwd">Re-enter Your Password</label>
            <input
              type="password"
              id="re-pwd"
              name="rePassword"
              value={formData.rePassword}
              onChange={handleChange}
            />
            {errors.rePassword && <p className="error-message">{errors.rePassword}</p>}
          </div>

          <div className="submit">
            <button type="submit">Create Account</button>
          </div>
        </form>
      </div>
    </>
  );
};

export default Signup;
